// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// import "../node_modules/@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract CoralPlaygroundMarket is ReentrancyGuard {
    using Counters for Counters.Counter;
    Counters.Counter private _itemIds;
    Counters.Counter private _itemsSold;

    address public owner;

    constructor() {
        owner = msg.sender;
    }

    struct MarketItem {
        uint itemId;
        address nftContract;
        uint256 tokenId;
        address payable seller;
        address payable owner;
        uint256 price;
        bool sold;
    }

    // MarketItem[] public itemsForSale;
    // mapping(address => mapping(uint256 => bool)) activeItems;
    mapping(uint256 => MarketItem) private idToMarketItem;

    event MarketItemCreated (
        uint indexed itemId,
        address indexed nftContract,
        uint256 indexed tokenId,
        address seller,
        address owner,
        uint256 price,
        bool sold
    );

    // Moralis Sync
    // MarketItemCreated(uint256, address, uint256, address, address, uint256, bool)

    event MarketItemSold (
        uint indexed itemId,
        address owner,
        uint price
        );

    // modifier OnlyItemOwner(address nftContract, uint256 tokenId){
    //     IERC721 tokenContract = IERC721(nftContract);
    //     require(tokenContract.ownerOf(tokenId) == msg.sender);
    //     _;
    // }

    // modifier HasTransferApproval(address nftContract, uint256 tokenId){
    //     IERC721 tokenContract = IERC721(nftContract);
    //     require(tokenContract.getApproved(tokenId) == address(this));
    //     _;
    // }

    // modifier ItemExists(uint256 id){
    //     require(id < itemsForSale.length && itemsForSale[id].itemId == id, "Could not find item" );
    //     _;
    // }

    // modifier IsForSale(uint256 id){
    //     require(itemsForSale[id].sold == false, "Could not find item" );
    //     _;
    // }

    function createMarketItem(
        address nftContract,
        uint256 tokenId,
        uint256 price
        ) 
        // OnlyItemOwner(nftContract, tokenId) 
        // HasTransferApproval(nftContract, tokenId) 
        nonReentrant public payable returns(uint256) {
            require(price > 0, "Price must be greater than 0");
            // require(activeItems[nftContract][tokenId] ==  false, "Item is already up for sale!");

            _itemIds.increment();
            uint256 itemId = _itemIds.current();

            idToMarketItem[itemId] =  MarketItem(
                itemId,
                nftContract,
                tokenId,
                payable(msg.sender),
                payable(address(0)),
                price,
                false
            );

            // activeItems[nftContract][tokenId] = true;
            // assert(itemsForSale[itemId].itemId == itemId);

            // IERC721(nftContract).transferFrom(msg.sender, address(this), tokenId);

            emit MarketItemCreated(
                itemId,
                nftContract,
                tokenId,
                msg.sender,
                address(0),
                price,
                false
            );
        return itemId;
    }

    function createMarketSale(
        address nftContract,
        uint256 itemId
        ) public payable 
        // ItemExists(itemId) IsForSale(itemId) 
        // HasTransferApproval(itemsForSale[itemId].nftContract,itemsForSale[itemId].tokenId) 
        nonReentrant {
            uint price = idToMarketItem[itemId].price;
            uint tokenId = idToMarketItem[itemId].tokenId;
            bool sold = idToMarketItem[itemId].sold;

            require(msg.value == price, "Please submit the asking price in order to complete the purchase");
            // require(msg.sender != itemsForSale[itemId].seller);
            require(sold != true, "This Sale has alredy finnished");

            idToMarketItem[itemId].seller.transfer(msg.value);
            // IERC721(nftContract).safeTransferFrom(address(this), msg.sender, tokenId);
            IERC721(nftContract).safeTransferFrom(idToMarketItem[itemId].seller, msg.sender, tokenId);
            idToMarketItem[itemId].owner = payable(msg.sender);
            _itemsSold.increment();
            idToMarketItem[itemId].sold = true;
            // activeItems[itemsForSale[itemId].nftContract][itemsForSale[itemId].tokenId] = false;

            // emit MarketItemSold( itemId, msg.sender, itemsForSale[itemId].price );
            emit MarketItemSold( itemId, msg.sender, price );

            // From old contract
            // itemsForSale[id].isSold = true;
            // activeItems[itemsForSale[id].tokenAddress][itemsForSale[id].tokenId] = false;
            // IERC721(itemsForSale[id].tokenAddress).safeTransferFrom(itemsForSale[id].seller, msg.sender, itemsForSale[id].tokenId);
            // itemsForSale[id].seller.transfer(msg.value);
        }

    function fetchMarketItems() public view returns (MarketItem[] memory) {
        uint itemCount = _itemIds.current();
        uint unsoldItemCount = _itemIds.current() - _itemsSold.current();
        uint currentIndex = 0;

        MarketItem[] memory items = new MarketItem[](unsoldItemCount);
        for (uint i = 0; i < itemCount; i++) {
            if (idToMarketItem[i + 1].owner == address(0)) {
                uint currentId = i + 1;
                MarketItem storage currentItem = idToMarketItem[currentId];
                items[currentIndex] = currentItem;
                currentIndex += 1;
            }
        }
        return items;
    }

}

